import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Dashboard from './components/Dashboard';
import IngresosPage from './components/IngresosPage';
import GastosPage from './components/GastosPage';
import RecordatoriosPage from './components/RecordatoriosPage';

function App() {
  return (
    <BrowserRouter>
      <nav style={{ padding: '10px', background: '#f0f0f0' }}>
        <Link to="/" style={{ marginRight: '15px' }}>Dashboard</Link>
        <Link to="/ingresos" style={{ marginRight: '15px' }}>Ingresos</Link>
        <Link to="/gastos" style={{ marginRight: '15px' }}>Gastos</Link>
        <Link to="/recordatorios">Recordatorios</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/ingresos" element={<IngresosPage />} />
        <Route path="/gastos" element={<GastosPage />} />
        <Route path="/recordatorios" element={<RecordatoriosPage />} />
      </Routes>
    </BrowserRouter>
  );
}
export default App;
